import react, { useState } from 'react';
const Codebeast=()=>{
    const [fullName,newf]=useState();
    const[name,setName]=useState();
    const inputevent=(obj)=>{
        setName(obj.target.value);
    };
    const gym=()=>{
        newf(name);

    };
    return(
        <><h1>Hello {fullName}</h1>
        <input type="text" placeholder="naam likh gandu"
        onChange={inputevent} value={name}/>
        <button onClick={gym}>Submit</button>
        </>
    );
}
export default Codebeast;
